import React from 'react';

const BookingHistory = () => {
  const bookings = [
    { id: 1, service: 'House Cleaning', date: '2024-09-20', status: 'completed', amount: '₹800' },
    { id: 2, service: 'Deep Cleaning', date: '2024-09-25', status: 'confirmed', amount: '₹1500' }
  ];
  return (
    <div className="max-w-5xl mx-auto px-4 py-8">
      <h1 className="text-2xl font-bold mb-4">Your Bookings</h1>
      <div className="bg-white rounded-lg shadow overflow-x-auto">
        <table className="min-w-full">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Service</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Date</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Status</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Amount</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {bookings.map(b => (
              <tr key={b.id}>
                <td className="px-6 py-4">{b.service}</td>
                <td className="px-6 py-4">{b.date}</td>
                <td className="px-6 py-4">{b.status}</td>
                <td className="px-6 py-4">{b.amount}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default BookingHistory;
